//www.alberta.ca/training-and-employment-services-workplace-training-program","Description":"Get reimbursed up to 70% of training costs for a new employee, for up to 30 weeks, but not more than $390/week. The Alberta Workplace Training program provides financial support for On-the-Job Training and Paid Work Experience aimed at improving employability and fostering skill acquisition. Each financing modality is designed to support individuals and employers in need, ensuring efficient use of allocated resources."},{"Title":"Alberta.ca Workforce Partnership Grants\\n","URL":"https://www.alberta.ca/workforce-partnerships-grants?_gl=1*16rg1xs*_ga*MTYxODExNTgwLjE3MzgwODEwNTA.*_ga_X61QE9GVEP*MTczODA5NzE0NS4yLjEuMTczODA5ODU4MC4wLjAuMA..","Description":"Alberta.ca Workforce Partnership grants provide funding to organizations such as employers, industry and sector associations, regional organizations and Indigenous organizations to support labour market adjustment strategies and workforce development, including initiatives to attract and retain workers through partnerships. Effective partnerships can improve the capacity of organizations to deal with workforce demands, implement labour force adjustments, address workforce issues and support economic growth on a regional and/or provincial level The Government of Alberta is working in partnership with the Government of Canada to provide employment support programs and services."},{"Title":"Allstate Foundation\\n","URL":"https://www.allstate.ca/webpages/about/foundation.aspx","Description":"The Allstate Foundation of Canada was established in 1977 to provide grants to charities and not-for-profit organizations that are involved in a variety of activities or educational initiatives focused around crime prevention, road safety or home safety."},{"Title":"ATCO\u2019s Community Equipment Program\\n","URL":"https://communityequipment.atco.com/","Description":"ATCO is helping event organizers reduce their rental costs while provides free-of-charge equipment for\xa0community and charitable organizations to help ensure a successful event! ATCO supports our communities by offering special event equipment, free-of-charge, for community and charitable organizations. They\u2019re helping event organizers reduce rental costs while providing equipment that ensures a successful event. All they ask in return is for the value of ATCO\u2019s contribution of the equipment to be recognized at your event at a level equal to renting and/or transporting it to the event.\xa0 Equipment includes BBQ\u2019s, canopy tents and open air or covered sound stage. BBQ\u2019s and canopy tents must be picked up but ATCO staff will deliver the soundstage to and from events on a trailer unit, set up, dismantle and return the soundstage back to ATCO for storage and maintenance."},{"Title":"ATB Cares\\n","URL":"https://www.atbcares.com/how-it-works/","Description":"The best way to donate to your favourite charity is through ATB Cares. ATB Cares makes it easy for all Albertans to support the causes they care about. Your charity of choice receives 100% of your donation through this site and ATB will match 15% of every dollar donated to Alberta, non-religious charities to an annual limit of $240,000. Eligible charities may receive up to $5,000 in matching per year. Individual donations qualify for a maximum donation match of $1,000.\xa0Join Now!"},{"Title":"Calgary Foundation Neighbour Grants","URL":"https://calgarycvo.us19.list-manage.com/track/click?u=87479974057b77ce5da291f61&id=4f2bcc338f&e=1ed803d34b","Description":"The Calgary Foundation\u2019s\xa0Neighbor Grants\xa0offer up to $7,500 to help people build their sense of inclusive belonging in their own neighbourhoods and communities. Registered charities must use a community development approach and have meaningful project leadership roles for grassroots people from the project community. Learn more about eligibility and the application process on the\xa0Calgary Foundation website."},{"Title":"Calgary COMMUNITY FOUNDATIONS Strategic Opportunity Grants\\n","URL":"https://calgaryfoundation.org/grantsawards-loans/types-of-grants/strategic-opportunity/","Description":"Strategic Opportunity Grants support small to mid-sized Calgary and area qualified donees with small, time-sensitive, strategic initiatives that fall into one of two categories. Organization Development or Program Development"},{"Title":"Calgary Foundation Impact Investing\\n","URL":"https://calgaryfoundation.org/grantsawards-loans/types-of-grants/","Description":"Open to charities and nonprofits. Debt financing (loans) to charities and non-profit organizations. \xa0Augments investments from traditional financial institutions or provides investments to organizations with credit capacity, but who are unable to secure financing from a bank or other financial institution."},{"Title":"Canada-Alberta Job Grant (CAJG)","URL":"https://www.alberta.ca/canada-alberta-job-grant.aspx","Description":"CAJG is\xa0an employer-driven training program where employers and government share the cost of training new and existing employees to increase their knowledge\xa0and skills to meet the needs of Alberta\u2019s changing economy."},{"Title":"Canva for Nonprofits\xa0Grants\\n","URL":"https://www.canva.com/canva-for-nonprofits/","Description":"A program specifically designed to provide nonprofits with access to\xa0Canva\u2019s\xa0premium design tools and resources at no cost or at a discounted rate. It allows nonprofits to create high-quality graphics, presentations, social media posts, and more to effectively communicate their message and mission."},{"Title":"Carthy Foundation Fund\\n","URL":"http://www.carthyfoundation.org/fund.html","Description":"What they Fund: Youth: Initiatives that have a primary focus on adolescent emotional health and wellness or on career transitions for youth and young adults. Environment: Initiatives that focus on market-based mechanisms, or urban ecology and ecological design. Average Grant Size: No defined range for grants. Projects are assessed and funded on a case-by-case basis."},{"Title":"Chevron Global Grants\\n","URL":"https://canada.chevron.com/community/apply-for-a-grant","Description":"Chevron Canada\u2019s areas of focus for community investment are\xa0health, education and training, and\xa0community capacity-building, identified as programs that address a community\u2019s ability to build and sustain long-term economic development. Organizations must be a registered charitable organization or a registered non-profit society. \xa0(British Columbia, Alberta, Newfoundland and Labrador)."},{"Title":"City of Calgary Arts & Culture Microgrants","URL":"https://www.calgary.ca/arts-culture/microgrant.html?mc_cid=a4bd837a89&mc_eid=1ed803d34b","Description":"Microgrant funding for arts and cultural projects within Calgary (events, workshops, installations, performances). Provides support for smaller-scale creative initiatives by covering eligible expenses, often at 100 % for smaller projects."},{"Title":"City of Edmonton Neighbourhood Connections Grants","URL":"https://www.edmonton.ca/programs_services/funding_grants/neighbourhood-connections-grant","Description":"Grants from $501 to $2,500 to support larger neighbourhood-wide civic or social projects, events or initiatives involving multiple community stakeholders to foster connection and engagement."},{"Title":"City of Edmonton Neighbourhoods Micro-grants","URL":"https://www.edmonton.ca/programs_services/funding_grants/micro-neighbourhood-grant","Description":"Small grants (up to approximately $500) to support local projects or events (block-level, small scale) that contribute to neighbourhood services or community outcomes."},{"Title":"City of Edmonton Revitalization Micro-grants","URL":"https://www.edmonton.ca/programs_services/funding_grants/revitalization-micro-grant","Description":"Grants (up to ~$500) for small, local projects/events specifically within designated revitalization neighbourhoods; initiatives must align with broader outcomes for community rejuvenation."},{"Title":"City of Red Deer FCSS Red Deer & District Agency Capacity Building Grant","URL":"https://www.reddeer.ca/about-red-deer/social-well-being-and-community-initiatives/family-and-community-support-services/fcss-initiatives/agency-capacity-building-grant/","Description":"Funding to help local non-profit or social agencies strengthen their internal capacity \u2014 e.g. governance, systems, staff training, program design \u2014 enabling more effective service delivery in the community."},{"Title":"City of Grande Prairie Emergency Community Group Funding","URL":"https://cityofgp.com/culture-community/grants-funding-awards/emergency-community-group-funding","Description":"Provides rapid response funding to community groups or agencies facing urgent or unforeseen needs; applicants must demonstrate financial need and justify the immediate nature of the request."},{"Title":"City of Grande Prairie Training Grant","URL":"https://cityofgp.com/culture-community/grants-funding-awards/training-grant","Description":"Helps local organizations pay for training or educational initiatives. For programs > $300, the grant covers 25 % of registration costs (max $2,500 per business), and for programs \u2264 $300, 50 % (max $1,250)."},{"Title":"CMHC Shelter Enhancement Program (SEP) On-Reserve","URL":"https://www.cmhc-schl.gc.ca/en/Developing-and-Renovating/Funding-Opportunities/on-reserve-renovation-programs/shelter-enhancement-program","Description":"Helps First Nations communities build or repair shelters and second-stage housing on reserves, focused on supporting those fleeing domestic violence."},{"Title":"CMHC Shelter Enhancement Program (SEP)","URL":"https://albertabusinessgrants.ca/grants/shelter-enhancement-program-sep-canada-mortgage-and-housing-corporation-cmhc/","Description":"Nationwide program to fund construction, repair, or renovation of shelter infrastructure and housing for those escaping domestic violence or needing transitional housing."},{"Title":"Commemorative Partnership Program","URL":"https://www.veterans.gc.ca/en/remembrance/commemorative-events/commemorative-partnership/engagement/guidelines","Description":"Federal funding to support community-based commemorative events and development of educational materials, aimed at remembrance and public engagement relating to veterans, armed forces, and national remembrance."},{"Title":"Community Forward Fund","URL":"https://communityforwardfund.ca/","Description":"Provides low-cost loans (not grants) to non-profits, charities, and social enterprises to support their operations or growth, enabling sustainable community impact."},{"Title":"COSTCO Charitable Contributions","URL":"https://www.costco.ca/community-relations-faq.html?langId=-24","Description":"Corporate giving program: Costco supports registered Canadian charities, especially in the realms of children, education, and health/human services, through donations or sponsorships."},{"Title":"Crowdfunding Alberta","URL":"https://www.alberta.ca/creative-partnerships-crowdfunding-alberta-platform","Description":"A matching program for non-profits in Alberta: when organizations run crowdfunding campaigns via the government\u2019s platform, the government matches a portion (e.g. 30 %) of funds raised during the first 8 weeks, helping amplify their fundraising."},{"Title":"Creating, Knowing and Sharing: The Arts and Cultures\u2026","URL":"https://canadacouncil.ca/funding/grants/creating-knowing-sharing/indigenous-organizations","Description":"A Canada Council for the Arts program that supports Indigenous organizations (First Nations, Inuit, M\xe9tis) in creating, preserving, or presenting artistic/cultural work, including collaborations and administrative support."},{"Title":"The Ed Stelmach Community Foundation","URL":"https://www.edstelmachfoundation.com/page/how-to-apply","Description":"Provides smaller grants (case-by-case) to Alberta-based, lesser-known charities, emphasizing high operational spend efficiency (a high percentage of revenue going into programs)."},{"Title":"Edmonton Community Foundation Small Grants","URL":"https://www.ecfoundation.org/grants/small-grants/","Description":"One-time grants (typically in the ~$10,000\u2013$15,000 range) to support stand-alone, immediate needs in Edmonton-area nonprofit initiatives."},{"Title":"Events Component of the Community Support, Multiculturalism, and Anti-Racism Initiatives","URL":"https://www.canada.ca/en/canadian-heritage/services/funding/community-multiculturalism-anti-racism/events.html","Description":"Federal funding for community-based events that promote intercultural understanding, diversity, anti-racism dialogues, or celebrate cultural heritage (e.g. heritage months)."},{"Title":"First Nations Development Fund Grant Program","URL":"https://www.alberta.ca/first-nations-development-fund-grant-program","Description":"Provincial (Alberta) funding for recognized First Nations to support economic, social, and community infrastructure projects on-reserve (lottery-set aside grants)."},{"Title":"F.L.R.P. Community Fund","URL":"https://www.benoitwellnessconsulting.com/flrp-community-fund","Description":"Provides financial support to frontline workers and their families facing crisis or emotional health challenges, especially where conventional benefits do not cover alternative therapies or crisis support."},{"Title":"Foyston Gordon and Payne Foundation","URL":"https://www.foyston.com/corporate-responsibility/the-foyston-gordon-and-payne-foundation","Description":"Supports smaller charities (especially those assisting children and Indigenous communities) with grants that are intended to make noticeable, lasting impact."},{"Title":"Google Ad Grants","URL":"https://www.google.com/grants/","Description":"Provides in-kind advertising credit (e.g. up to US$10,000/month) to eligible nonprofits to use for Google Ads campaigns (recruitment, visibility, fundraising, awareness)."},{"Title":"Government of Canada First Nations and Inuit Home and Community Care","URL":"https://www.sac-isc.gc.ca/eng/1582550638699/1582550666787","Description":"Federal funding to help Indigenous communities plan, develop, and sustain home care or community care services (health, support, elder care) for populations in First Nations and Inuit communities."},{"Title":"Government of Canada Multiculturalism and Anti-Racism Program","URL":"https://www.canada.ca/en/canadian-heritage/services/funding/multiculturalism-anti-racism/events.html","Description":"Grants funding community-based initiatives promoting diversity, inclusion, anti-racism, cultural understanding, and supporting minority communities."},{"Title":"Government of Canada, the Investment Readiness Program (IRP)","URL":"https://irp-ppi.ca/en/about-the-program/","Description":"Supports social purpose organizations (nonprofits, charities, co-ops, social enterprises) to develop capacity to attract investment, scale, and prepare for social finance opportunities."},{"Title":"Government of Canada Community Economic Development & Diversification (CEDD) \u2013 Prairie Provinces","URL":"https://www.canada.ca/en/prairies-economic-development/services/funding/community-economic-development-diversification.html","Description":"Funding for projects in Alberta/Saskatchewan/Manitoba to stimulate inclusive economic growth, diversification, infrastructure, innovation, and community development."},{"Title":"Harry and Martha Cohen Foundation","URL":"http://hmcohenfoundation.com/application-procedures/","Description":"Calgary-based foundation awarding small grants (averaging CAD $1,000\u2013$2,000) to local charities in the areas of arts, culture, and social services."},{"Title":"Honda Canada Foundation","URL":"https://www.hondacanadafoundation.ca/home","Description":"Supports youth and educational programs in Canada; focuses on initiatives that help youth and education, often in municipalities where Honda operates."},{"Title":"HJR Consulting","URL":"https://www.hrjconsulting.com/giving-immediate-assistance","Description":"Grants and philanthropic support aimed at organizations working with children, youth, families in economic hardship; emphasis on immediate-assistance programs."},{"Title":"Imperial Community Investment Fund","URL":"https://www.imperialoil.ca/en-CA/Sustainability/Community-investment","Description":"Supports community initiatives in areas such as innovation & sustainability, Indigenous leadership, and strengthening non-profit operations."},{"Title":"INSPIRIT Foundation Grants","URL":"https://inspiritfoundation.org/grants-and-programs/grants/","Description":"Provides project grants (CAD 10,000\u2013100,000) and multi-year funding in areas such as equity, narrative change, media, representation, and systemic change."},{"Title":"INSPIRIT Foundation Research & Sector-building Grants","URL":"https://inspiritfoundation.org/grants-and-programs/grants/","Description":"Funding (up to ~$50,000) for research projects that inform policy, build sector capacity, and mobilize knowledge for equity and social justice work."},{"Title":"Indigenous Community Support Fund","URL":"https://www.sac-isc.gc.ca/eng/1585189335380/1585189357198","Description":"Federal fund to help Indigenous communities respond to and recover from COVID-19, including health, economic, social supports."},{"Title":"Keg Spirit Foundation Funding","URL":"http://www.kegsteakhouse.com/en/keg-spirit-foundation","Description":"Corporate foundation from Keg Restaurants; supports new and established community projects aligned with their criteria (often hospitality, community building)."},{"Title":"McLean Foundation","URL":"https://calgarycvo.us19.list-manage.com/track/click?u=87479974057b77ce5da291f61&id=f6fbce69eb&e=1ed803d34b","Description":"Grants to projects or organizations that may not receive traditional funding, especially those with strong community or environmental impact; supports general operations or new projects."},{"Title":"Max Bell Foundation Project & Development Grants","URL":"https://www.maxbell.org/apply-for-funding/","Description":"Grants for specific community projects or organizational development in areas such as policy, journalism, environment, and community dialogue."},{"Title":"Muttart Bursary Program & Leadership Bursary Program","URL":"https://muttart.org/granting-programs/bursary-program/program-details/","Description":"Muttart Bursary Program\\nGrants are usually awarded in amounts of less than $1,500 to cover the tuition or registration costs of courses, programs, conferences or other training opportunities. Courses or programs must be offered by a non-profit entity or a publicly funded post-secondary institution.\\nMuttart Leadership Program\\nThe aim of the Leadership Bursary program is to increase the capacity of senior staff, management staff, or persons serving in a senior staff capacity within these charities to contribute now, or in the near future, to leadership within or across organizations, or enhance leadership competence in key policy areas related to the charity or sub-sector\u2019s work."},{"Title":"Microsoft Grant","URL":"https://www.microsoft.com/en-us/nonprofits/eligibility","Description":"Grants\xa0\u2013 Granted licenses are only permitted for paid employees and unpaid executive staff if all organization eligibility is met. User amount limits do apply and vary by availability of country of usage. Additionally, organizations are expected to regularly remove unused granted licenses from their subscription. Adherence to policy guidance is encouraged, and tenants may be subject to audit by Microsoft.\\nDiscounts\xa0\u2013 Discounted licenses are permitted for all staff, including volunteers and temporary staff of the organization. Eligible nonprofits may access discounted pricing on commercial cloud offers and some on-premise offers. Discounts vary by product and/or quantity."},{"Title":"Nova Chemicals Community Investment Fund","URL":"https://www.novachem.com/locations/joffre-ab-canada/community-investment/","Description":"Corporate community investment fund; funds community-focused projects in areas around Nova Chemicals\u2019 operations (e.g. education, environment, community development)."},{"Title":"Piikani Youth & Education Foundation Group & Community Grants","URL":"https://www.pyef.org/Funding/group-community-grants","Description":"Grants (e.g. $2,000) to Piikani Nation groups or projects focused on youth, education, community betterment within the Piikani community."},{"Title":"RBC Youth Mental Well-being Project","URL":"https://www.rbc.com/community-social-impact/apply-for-funding/youth-mental-wellbeing-guidelines.html","Description":"Funding for programs that improve access to mental health supports for youth and families, with preference for collaborative, outcome-driven models."},{"Title":"R. Howard Webster Foundation","URL":"https://www.rhowardwebsterfoundation.ca/about-us/mission-funding-areas/","Description":"Canadian foundation granting to nonprofits in arts & culture, education, environment, health, and social services; supports unique, high-impact programming."},{"Title":"Safeway Canada Provincial & Regional Donations/Sponsorships","URL":"https://www.safeway.ca/about-us/community-involvement/apply-for-support/","Description":"Corporate community giving program supporting food security, health, disabilities, community-based initiatives that align with Safeway\u2019s priorities."},{"Title":"Shell Canada Community Funding","URL":"https://www.shell.ca/en_ca/shell-in-the-community/communities/funding-guidelines-process.html","Description":"Corporate giving program: grants and support for community organizations in areas around Shell\u2019s operations; often emphasis on sustainability, youth, infrastructure, environment."},{"Title":"Silver Gummy Foundation Indigenous Grant","URL":"https://silvergummy.org/indigenous-grant/","Description":"Funds Indigenous-